import React from "react";

function contont(){
        return(
            <div>
                <label htmlFor="in1"> JavaScript</label>
                <input type="checkbox" id="in1"></input>
                <label htmlFor="in2">python</label>
                <input type="checkbox" id="in2"></input>
                <label htmlFor="in3">C++</label>
                <input type="checkbox" id="in3"></input>
            </div>
            )
}

export default contont;
